import { createSlice } from "@reduxjs/toolkit";

const UserSlice = createSlice({
  name: "User",
  initialState: [
    {
      id: 1,
      name: "John",
      lastname: "Doe",
    },
    {
      id: 2,
      name: "Jane",
      lastname: "Smith",
    },
    {
      id: 3,
      name: "Alice",
      lastname: "Johnson",
    },
    {
      id: 4,
      name: "Bob",
      lastname: "Brown",
    },
  ],
  reducers: {
    listUser: (state, action) => {},
    addUser: (state, action) => {},
  },
});

export const { listUser, addUser } = UserSlice.actions;

export default UserSlice.reducer;
